-- Dữ liệu cho bảng vaccine_news_type
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00001', 'Hoặc chưa như của có này mà chưa. Thay nơi và với đến nhưng mỗi của. Vài nếu từ với tại với.
Gần vẫn với của từng của. Số người đang để.
Nào này khiến hơn. Từ như hơn như đi nơi. Như thay cho của đi.', 'làm');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00002', 'Cho làm không để từng. Đúng giữa tôi. Từ giữa đó tại đó của như.
Để có sau giữa rất.
Chưa để điều nào. Của vì như dưới chỉ mà. Để bạn được đang.
Cho nhưng rất hơn gần dưới. Một vẫn tại vậy đến không cái. Thì giống như là giữa đi hơn vẫn.', 'tôi');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00003', 'Dưới sẽ với sẽ từ cách nhưng. Để có là chưa được gần.
Một từ nào đó vì.
Thì vì bạn. Này cho số làm giống.
Đúng các theo để với không người từ.
Các trong số trong. Từng tại cũng để điều.
Nơi với và và. Tại được vẫn đã gần. Cũng một chưa như sẽ và.', 'thay');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00004', 'Nhiều tự đi hơn nào của chỉ được. Chưa với thay dưới điều gần lớn rất. Tại hơn chưa vẫn cũng đúng.
Là đó giống của số này theo. Từng như với vì để vẫn.', 'trong');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00005', 'Với đang một để số như. Với chưa như giống. Của từ đúng giống.
Thay cách có như cái để từ. Tự để của.
Không vài của với như giống hơn như. Của các bạn gần cái. Cũng người mà và đã cũng vẫn gần.', 'tự');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00006', 'Và như từ tự vài không trong. Giữa dưới là vài cách với. Nào đang khiến sau nào số.
Đã dưới cũng dưới được trong được. Để nhưng của đi giống số. Từ từ với đó từ sau.
Đã sau đi sau cho như từng. Nếu khiến vài cũng. Thay hơn vẫn hơn.', 'nhưng');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00007', 'Từng về sẽ thế bên. Của nhiều sau đã.
Vẫn tự từ tại dưới vì bạn. Về điều sau về.
Lớn vẫn làm của cái người đến. Thì sau về điều rất. Có cũng người là nơi.
Giữa số không. Có với như của trong của vài sẽ.', 'có');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00008', 'Nếu với hơn trong các với hoặc. Để lớn các của nơi cũng để.
Bên gần có của khiến. Khiến tại của nếu hơn tại cách. Tự nếu sẽ được khi nhưng.
Đi có về của sau. Đang cũng tại điều có tự dưới. Là để nơi cũng hơn sau hơn.', 'để');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00009', 'Các để để với vì dưới với. Đúng người được với làm các. Sẽ cũng thì tôi cho đó tôi. Để này mà của.
Tự hoặc khi là đến đó trong. Chỉ vì có với đang sau của tại. Người được gần gần.
Dưới như hơn không. Không sẽ có người. Mỗi gần trong sẽ đến cũng.', 'nếu');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00010', 'Từ cũng vậy trong tôi. Nơi để như nếu bạn hơn.
Thay vì với bạn để sẽ. Đi về hơn sẽ như để khiến. Đang như như đi thế trong để.
Người nhiều hơn như nhưng khiến. Giữa tại khiến sẽ.
Tại có hơn bạn hơn không. Chỉ của có. Bạn tôi các các lớn tại gần.', 'điều');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00011', 'Vậy hơn theo điều lớn đến. Hoặc để điều mà. Cũng về số chỉ.
Đến đi nơi hơn. Đang gần nhưng như. Theo vẫn dưới từ bạn.
Nhưng chỉ để vậy cách. Có đã thay được với vẫn đi.
Hoặc tại tự giữa. Tại mà mỗi khiến thay tự. Thì vì đã hơn giữa đó.', 'vì');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00012', 'Giữa mỗi một tự về. Lớn rất như vẫn trong người vài. Khi giữa tự như các bên là.
Đến có để của của từng đang. Lớn tự vậy của có hơn điều nếu. Của của không theo giống chỉ.', 'đến');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00013', 'Khi hoặc giữa. Các mà gần của. Nhiều cũng cách số mỗi.
Như trong đang mà của làm sẽ để. Có để hơn nếu một có hơn.
Gần làm để của nếu khiến.
Dưới bạn làm hơn cũng sau để hoặc. Vài vậy đến về. Điều bên khi cũng đang có mỗi thì.', 'như');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00014', 'Sau và vài chưa khi không như vì. Từng tại hơn tôi đang dưới. Đó số hoặc để.
Cũng như chưa. Hoặc với sau đã như tự đã. Đó nào từ hơn.
Và được điều như hơn khiến nhiều. Với dưới khiến.
Cách tôi lớn từ tại đã vài đúng. Đã về người của từ đang.', 'là');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00015', 'Đã tự sau rất khiến làm. Hơn cách khiến của. Tại theo nhưng của.
Điều nơi này vài một cũng. Cũng nhưng để các điều và bên.
Dưới từ đang theo. Cái trong có đi về người về đến. Như vậy đang. Của người này mỗi có đó hoặc.', 'đó');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00016', 'Đến như giống khi bên với làm. Của đó hơn khiến.
Hơn từ theo lớn khi và. Với thay đã rất chưa đã có.
Làm với lớn như trong. Trong sẽ cũng nếu có tại để các.
Điều theo đến chưa. Mỗi gần như làm không cũng sau điều. Của rất và gần đó.', 'rất');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00017', 'Từ khi thế đã nơi giữa này. Này rất như sau hơn đến cũng.
Làm thay đến về cũng vậy nhưng. Không với đó khi mỗi. Làm khi theo mà.
Đi từng theo sau. Cách hơn để cũng với.
Để khiến hơn có. Mỗi nếu tôi.
Bên để đang trong là để nào. Tôi như nào của.', 'đi');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00018', 'Đúng tại được nếu để. Về và điều mà được bạn. Vì hơn chưa vài nếu. Bên làm vẫn.
Đi chưa đã và. Từ nhưng để đúng tại giống có của.
Khiến đã hơn từ cái. Mà thế cho như. Là giữa và dưới từ vài cũng.
Có mà cho thay. Để và khiến sẽ này. Với của đúng khiến.', 'mỗi');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00019', 'Như về đã các. Một cũng giống gần từ đang vài.
Bạn của tôi chỉ cách trong đi. Tại chỉ tôi từng. Khi sau nếu trong. Để nếu một của tại.
Rất số giống khi theo điều. Trong để nào. Các bên như về.', 'dưới');
INSERT INTO vaccine_news_type (news_type_id, news_type_description, news_type_name) VALUES ('VMNT00020', 'Lớn giống chỉ đến này để tại tự. Cũng số từng để nơi các và. Cho nhưng theo hơn của.
Đó tại lớn với làm. Có cho cũng đang nào nhưng.
Rất của tại để với. Từng dưới đó tại và.
Sau từ theo cái tại.
Có sẽ của mà một. Bạn của thế tại.', 'thế');

